import React, { Component } from "react";
import {
  Card,
  Container,
  Button,
  Navbar,
  Nav,
  Row,
  Col
} from "react-bootstrap";

const Footer = () => {
  return (
    <footer>
        {/* FOOTER TOP */}
      <Navbar className="footerTop">
        <Nav className=" footerTopElementOne mr-auto">
          <Nav.Link href="#home">Promo Code</Nav.Link>
          <Nav.Link href="#features">Features</Nav.Link>
          <Nav.Link href="#pricing">Pricing</Nav.Link>
        </Nav>
        <Nav className="mr-5">
          <Nav.Link href="#home">Facebook</Nav.Link>
          <Nav.Link href="#features">Tweeter</Nav.Link>
        </Nav>
      </Navbar>
        {/* FOOTER BOTTOM */}
        <Navbar className="footerBottom">
        <Nav className="mr-5">
          <Nav.Link href="#home">LOGO</Nav.Link>
        </Nav>
      </Navbar>
    </footer>
  );
};

export default Footer;
